webpackJsonp([0xac5bb0ee852b],{381:function(e,a){e.exports={data:{markdownRemark:{html:'<p>Today we are happy to announce the three Platinum Sponsors for PyCon APAC 2018.\nAll three sponsors committed very early in our planning phase and are listed\nin no specific order. It is largely to their generous contribution that we\nwere able to make PyCon APAC 2018 a three-day event for the first time, without\nraising our ticket prices.</p>\n<hr />\n<div style="margin-bottom: 2em; max-width: 300px; margin-left: auto; margin-right: auto;"><a href="https://traveloka.com">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 480px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 22.499999999999996%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="sponsor traveloka" title="" src="/static/sponsor-traveloka-b9c232abdba9f04115c794b684e2bd8d-64e74.png" srcset="/static/sponsor-traveloka-b9c232abdba9f04115c794b684e2bd8d-53de2.png 208w,\n/static/sponsor-traveloka-b9c232abdba9f04115c794b684e2bd8d-5dd2f.png 416w,\n/static/sponsor-traveloka-b9c232abdba9f04115c794b684e2bd8d-64e74.png 480w" sizes="(max-width: 480px) 100vw, 480px">\n    </span>\n  </span>\n  </a></div>\n<p>Traveloka is Southeast Asiaâ€™s leading online travel and mobility\ncompany, rapidly expanding its commanding Indonesian presence into the\nrest of SouthEast Asia and beyond. Traveloka is known by its customers\nfor enabling mobility, empowering travel, and creating moments that\nbring loved ones together and propel them across the globe.</p>\n<p>At its heart, Traveloka aims to be a world-class technology and data\norganization with first-rate products and its widely-recognized\ncontributions and investments in technology and people. The technology\nand data teams are responsible together for the design, development,\nand operations of the integrated human-machine systems running the\ncore business, decisions systems, and various functions at Traveloka.</p>\n<p>Founded in 2012 in jakarta by ex-Silicon Valley engineers, Traveloka\nis now operating in 7 countries and has tech centres in Jakarta,\nSingapore, and Bangalore and stays true to its roots of innovating and\nexperimenting with new endeavours that will create impacts in the\nlives of our customers, and the markets and industries we touch.</p>\n<hr />\n<div style="margin-top: 2em; margin-bottom: 2em; max-width: 300px; margin-left: auto; margin-right: auto;"><a href="https://gandi.net">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 480px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 29.583333333333332%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="sponsor gandi" title="" src="/static/sponsor-gandi-eb5aa60da48bdc662acb98e4ce68f483-64e74.png" srcset="/static/sponsor-gandi-eb5aa60da48bdc662acb98e4ce68f483-53de2.png 208w,\n/static/sponsor-gandi-eb5aa60da48bdc662acb98e4ce68f483-5dd2f.png 416w,\n/static/sponsor-gandi-eb5aa60da48bdc662acb98e4ce68f483-64e74.png 480w" sizes="(max-width: 480px) 100vw, 480px">\n    </span>\n  </span>\n  </a></div>\n<p>Gandi was among the first domain name registrars to offer ".COM" and\n".NET" and now manages over 2 million domain names with accreditation\nfor over 700 different domain name extensions for its customers,\nplacing Gandi among the top domain name registrars worldwide. The\ncompany supports open source initiatives instead of spending money on\nadvertisement. In addition, Gandi\'s Corporate service is used by\nbrands and companies worldwide to secure their domain names and\nprotect their brand.</p>\n<hr />\n<div style="margin-top: 2em; margin-bottom: 2em; max-width: 300px; margin-left: auto; margin-right: auto;"><a href="https://hde.co.jp">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 480px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 35.208333333333336%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="sponsor hde" title="" src="/static/sponsor-hde-4541232a27f68014c127fcc263f13561-64e74.png" srcset="/static/sponsor-hde-4541232a27f68014c127fcc263f13561-53de2.png 208w,\n/static/sponsor-hde-4541232a27f68014c127fcc263f13561-5dd2f.png 416w,\n/static/sponsor-hde-4541232a27f68014c127fcc263f13561-64e74.png 480w" sizes="(max-width: 480px) 100vw, 480px">\n    </span>\n  </span>\n  </a></div>\n<p>HDE is one of the first IT ventures in Japan, established 22 years\nago. Owning over 73% market share in the whole of Japan, HDE is the #1\ncloud-based security provider based in Tokyo, Japan. With over 3.5\nmillion users in over 4,000 companies, they have keenly presented\nthemselves in the global plenary; from expanding their business to global\nplenary, to changing their main language to English and having 20% of\ntheir employees international. As their business continuously grows and\nexpands, they are looking for talented engineers (front-end, back-end,\ndata) to join their team in Tokyo.</p>\n<hr />\n<p>All three of our Platinum Sponsors will have a booth at the conference, so\ndon\'t miss your chance to get to know them in person when you attend the\nconference!</p>',frontmatter:{date:"May 23, 2018",path:"/news/platinum-sponsors",title:"Platinum Sponsors for PyCon APAC 2018"}}},pathContext:{}}}});
